import React from "react";
import {
  Container,
  Text,
  CommandButton,
  PrimaryButton,
  SearchInput,
  OutlinedButton,
  ActionButton,
  Header,
  Input,
  TextInput,
} from "../../styledComponents";
import styled from "styled-components";
import HouseItem from "../HouseItem";
import CreateHouse from "./create/CreateHouse";

const SearchWrapper = styled(Container)`
  display: flex;
  width: 100%;
  flex-direction: row;
  padding: 20px 110px 10px 110px;
  /* background-color: white; */
`;
const Wrapper = styled(Container)`
  display: flex;
  flex-direction: column;
  width: 100%;
  padding: 0px 110px;
`;
const ActionBtn = styled(ActionButton)`
  display: flex;
  justify-content: center;
  align-items: center;
  align-content: center;
  padding-right: 10px;
  padding-left: 10px;
  border-radius: 2px;
  background-color: ${({ theme }) => theme.lightGrey};
`;
const SearchBox = styled(Container)`
  display: flex;
  flex-direction: row;
  align-items: center;
  padding-right: 10px;
  padding-left: 10px;
  height: 32px;
  min-width: 200px;
  margin-right: 10px;
  background-color: ${({ theme }) => theme.lightGrey};
`;
const Houses = (props) => {
  return (
    <Container flex={1}>
      <SearchWrapper>
        <Header>Your Houses</Header>
      </SearchWrapper>
      <Wrapper>
        <Container
          right
          center
          row
          customStyles={{ paddingTop: 10, paddingBottom: 10 }}
        >
          <SearchBox>
            <TextInput />
          </SearchBox>
          <CreateHouse />
        </Container>
        <Container flex={1} row customStyles={{ flexWrap: "wrap" }}>
          {props.houses &&
            props.houses.map((house) => {
              return <HouseItem key={house.id} house={house} {...props} />;
            })}
        </Container>
      </Wrapper>
    </Container>
  );
};

export default Houses;

